import React from 'react';



const NavigationItem = (props) =>{

      switch(props.children.props.src){

         case "logo":
            return (
               <li className ="NavigationItem">
                  <a
                     href={props.link}
                     className={props.active? "active" : null}>s
                     {props.children}
                  </a>
               </li>
            );

         case "homeIcon":
            return (
               <li className ="NavigationItem">
                  <a
                     href={props.link}
                     className={props.active? "active" : null}>
                     {props.children}
                  </a>
               </li>
            );

         case "hotelIcon":
            return (
               <li className ="NavigationItem">
                  <a
                     href={props.link}
                     className={props.active? "active" : null}>
                     {props.children}
                  </a>
               </li>
            );

         case "searchIcon":
            return (
               <li className ="NavigationItem">
                  <a
                     href={props.link}
                     className={props.active? "active" : null}>
                     {props.children}
                  </a>
               </li>
            );

         case "profileIcon":
            return (
               <li className ="NavigationItem">
                  <a
                     href={props.link}
                     className={props.active? "active" : null}>
                     {props.children}
                  </a>
               </li>
            );

      }

   };

export default NavigationItem;
